import React from 'react';
import { motion } from "framer-motion";
import {header, leterOne, leterTwo, leterThree} from './Animations';
import { FaDice } from 'react-icons/fa';
import { NavRow } from './NavRow';
import { HRHeader } from './HRHeader';
import { HRDanger } from './HRDanger';

export const HRLanding = () => {
    return (
        <>
        <motion.button className='toggle' variants={leterOne} initial='init' animate='after'><FaDice size='50px' /></motion.button>
            <HRHeader />
            <NavRow />
            <HRDanger />
        </>
    )
}
